nito Sans&quot;; font-size: 36px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 254px; height: 88px; top: 1405px; left: 623px; text-align: center; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Business Rules Extraction </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 36px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 169px; height: 48px; top: 1445px; left: 1527px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Migration </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel hd" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 400; font-family: &quot;Nunito Sans&quot;; font-size: 30px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 1752px; height: 191px; top: 899px; left: 84px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Application modernization is the migration of legacy to new applications or platforms, including the integration of new functionality to provide the latest functions to the business. Modernization options includere rehosting, replatforming, refactoring, rearchitecting, rebuilding or replacing legacy systems to deliver latest technology at the best value. </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family odernization? </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 36px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 1364px; height: 48px; top: 1134px; left: 278px; text-align: center; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Implement Modernization Methodically and Avoid Business Disruption Through: </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel hd" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 400; font-family: &quot;Nunito Sans&quot;; font-size: 20px; color: rgb(112, 112, 112); background: transparent; border-width: 0px; padding: 0px; width: 813px; height: 406px; top: 1748px; left: 103px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Legacy applications provide business-critical functions within the enterprise application landscape but incur large operations and maintenance costs. Additionally, they pose a number of challenges including unsupported hardware and software, inflexible and closed architectures, lack of integration, and limited technical resources. When your organization is challenged by legacy applications, you need to know how much of an overhaul or commitment modernization will take. Your systems should be aligned, reliable and compatible, while cutting down on excess work and overlapping processes that slow you down. </label></div><div _ngcontent-hui-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-hui-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !import  absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 27px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 154px; height: 66px; top: 1973px; left: 21px; text-align: center; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Application Assessment </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 27px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 143px; height: 36px; top: 2326px; left: 32px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Integration </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 48px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 421px; height: 193px; top: 826px; left: 48px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> What is Application Modernization? </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 29px; color: rgb(255, 255, 255); background: transparent; border-width: 0px; padding: 0px; width: 435px; height: 122px; top: 1688px; left: 48px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Implement Modernization Methodically and Avoid Business Disruption Through: </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel hd" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 400; font-family: &quot;Nunito Sans&quot;; font-size: 20px; color: rgb(112, 112, 112); background: transparent; border-width: 0px; padding: 0px; width: 368px; height: 854px; top: 2787px; left: 48px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Legacy applications provide business-critical functions within the enterprise application landscape but incur large operations and maintenance costs. Additionally, they pose a number of challenges including unsupported hardware and software, inflexible and closed architectures, lack of integration, and limited technical resources. When your organization is challenged by legacy applications, you need to know how much of an overhaul or commitment modernization will take. Your systems should be aligned, reliable and compatible, while cutting down on excess work and overlapping processes that slow you down. </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !important; font-weight: 800; font-family: &quot;Nunito Sans&quot;; font-size: 36px; color: rgb(6, 41, 126); background: transparent; border-width: 0px; padding: 0px; width: 144px; height: 68px; top: 3881px; left: 111.667px; text-align: left; transform: rotate(0deg) skewX(0deg) skewY(0deg); box-shadow: 0px 0px; z-index: 1;"> Assess </label></div><div _ngcontent-xnw-c3=""><!----><!----><!----><!----><!----><!----><!----><!----><!----><label _ngcontent-xnw-c3="" class="ailabel" style="line-height: 1.2;border-style: solid; position: absolute !
